const Buttons = ({buttonText,setCurrPage, currPage}) => {
  return (
        <button
            className={currPage === buttonText ? "selected" : "" }
            onClick={(e)=>setCurrPage(e.target.innerText)}
        >
            {buttonText}
        </button>
  )
}

export default Buttons
